import React from "react";
import Navbar from "../components/common/navbar";
import { motion } from "framer-motion";
import { Check } from 'lucide-react';

function Price() {
    const packages = [
        {
            title: "PEMULA",
            description: "Langkah awal untuk mengenal dan memulai perjalanan Web Development anda",
            price: "Rp99.000/bulan",
            features: [
                "Akses ke CSS, HTML dan Javascript Module",
                "Certification vouchers",
                "1,000+ hands-on scenarios",
                "1x CTF event (24h)",
                "CVE-based scenarios",
                "Purple team scenarios"
            ],
            buttonText: "Mulai Sekarang",
            delay: 0.2
        },
        {
            title: "MENENGAH",
            description: "Tingkat Lanjutkan Skill anda dalam pengembangan Website Yang Lebih Modern menggunakan Framework",
            price: "Rp199.000/bulan",
            features: [
                "Akses ke Module HTML, CSS, Javascript",
                "5 Beginner Friendly Project",
                "Access Ke Forum Konsultasi",
                "Sertifikat Penyelesaian Modul",
                "Mentoring Session",
                "Advanced Project Cases"
            ],
            buttonText: "Mulai Sekarang",
            popular: true,
            delay: 0.3
        },
        {
            title: "AHLI",
            description: "Paket Tingkat Lanjut yang ditujukan kepada Junior-Senior Web Developer",
            price: "Rp299.000/bulan",
            features: [
                "Akses ke Module HTML, CSS, Javascript",
                "5 Beginner Friendly Project",
                "Access Ke Forum Konsultasi",
                "Sertifikat Penyelesaian Modul",
                "1-on-1 Mentoring",
                "Job Connect Program"
            ],
            buttonText: "Mulai Sekarang",
            delay: 0.4
        },
        {
            title: "SEKOLAH",
            description: "Program khusus untuk institusi pendidikan dengan fitur dan dukungan lengkap",
            price: "Hubungi Kami",
            features: [
                "Akses ke Module HTML, CSS, Javascript",
                "5 Beginner Friendly Project",
                "Access Ke Forum Konsultasi",
                "Sertifikat Penyelesaian Modul",
                "Dedicated Support",
                "Custom Learning Path"
            ],
            buttonText: "Contact Support",
            isEnterprise: true,
            delay: 0.5
        }
    ];

    return (
        <div className="min-h-screen bg-[#0A1525] text-white">
            <Navbar />
            
            <div className="container px-4 py-24 mx-auto">
                {/* Header Section */}
                <motion.div
                    initial={{ opacity: 0, y: 20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.6 }}
                    className="mb-16 text-center"
                >
                    <h1 className="mb-6 text-4xl font-bold text-transparent md:text-5xl bg-gradient-to-r from-cyan-400 to-blue-500 bg-clip-text">
                        Harga dan Paket
                    </h1>
                    <p className="max-w-2xl mx-auto text-lg text-gray-400">
                        Pilih paket yang sesuai dengan kebutuhan belajar Anda
                    </p>
                </motion.div>

                {/* Pricing Cards Grid */}
                <div className="grid grid-cols-1 gap-8 md:grid-cols-2 lg:grid-cols-4">
                    {packages.map((pkg, index) => (
                        <motion.div
                            key={pkg.title}
                            initial={{ opacity: 0, y: 20 }}
                            animate={{ opacity: 1, y: 0 }}
                            transition={{ duration: 0.5, delay: pkg.delay }}
                            className={`relative rounded-xl overflow-hidden ${
                                pkg.popular 
                                    ? 'border-2 border-cyan-500' 
                                    : 'border border-gray-700'
                            } bg-gray-800/50 backdrop-blur-sm group hover:border-cyan-500/50 transition-all duration-300`}
                        >
                            {pkg.popular && (
                                <div className="absolute top-4 right-4">
                                    <span className="px-2 py-1 text-xs font-semibold text-white rounded-full bg-cyan-500">
                                        Popular
                                    </span>
                                </div>
                            )}

                            <div className="p-6">
                                <h2 className="mb-4 text-2xl font-bold">{pkg.title}</h2>
                                <p className="h-20 mb-6 text-gray-400">{pkg.description}</p>
                                <div className="mb-8">
                                    <span className="text-3xl font-bold">{pkg.price}</span>
                                </div>

                                <motion.button
                                    whileHover={{ scale: 1.02 }}
                                    whileTap={{ scale: 0.98 }}
                                    className={`w-full py-3 px-4 rounded-lg font-medium mb-8 ${
                                        pkg.isEnterprise 
                                            ? 'bg-gray-700 hover:bg-gray-600' 
                                            : 'bg-gradient-to-r from-cyan-500 to-blue-500 hover:opacity-90'
                                    } transition-all duration-300`}
                                >
                                    {pkg.buttonText}
                                </motion.button>

                                <div className="space-y-4">
                                    <p className="font-medium text-gray-300">Akses To</p>
                                    {pkg.features.map((feature, idx) => (
                                        <div key={idx} className="flex items-start gap-3">
                                            <Check className="w-5 h-5 text-cyan-400 mt-0.5" />
                                            <span className="text-gray-300">{feature}</span>
                                        </div>
                                    ))}
                                </div>
                            </div>
                        </motion.div>
                    ))}
                </div>
            </div>
        </div>
    );
}

export default Price;
